import React, {useEffect} from 'react';
import { movies } from "./components/movies";
import './App.css';

function App() {
  const [movies, setMovies] =setState([])
  useEffect(() => {
    fetch('/movies').then(response => response.json().then(data => {
      setMovies(data)
    }))
  }, []);


  return (
    <div className="App">
      <movies movies = {movies}/>
    </div>
  );
}

export default App;
